export default function HamburgerButton({ isSidebarOpen }) {
  return (
    <div className="hamburger-button">
      <button className="btn">
        <svg
          src="assets/images/menu/menu_20dp_000000_FILL0_wght400_GRAD0_opsz20.svg"
          alt="menu open"
        />
      </button>
    </div>
  );
}
